import React, { useState } from 'react'
import { StatusBar } from 'expo-status-bar';
import { SafeAreaView, Switch, StyleSheet, Text, View, Button } from 'react-native';
import styles from './Appstyles'    


export default function Movie({navigation, route }) {
    const { current } = route.params;
    const film = JSON.stringify(current);
    return(
    <SafeAreaView style={styles.container}>
        <Text style={styles.largeHeading}>{current.title}</Text>
        <Button title='Go to home' onPress={() => navigation.navigate('Home')} />
        <Button title='Go to details' onPress={() => navigation.navigate('Details')} />
    </SafeAreaView>
    );
}
